- input: "TEXT\x1CC00004606\x1C.TEXT\x1C\x1CF3XA\x1C1. The receipt of $2,227.57 from
    the Kansas Republican Party State Account was for the nonfederal share of allocated
    disbursements for administrative purposes. This change has been reflected. The
    $7000 receipt from the Kansas Republican Party State Account has been reimbursed
    to the nonfederal account and will be reported as such on our March 20 report.
    A photocopy of this check has been mailed to the Federal Elections Commission
    office, attention to Alexandra Broomhead. 2. On Schedule H3 supporting Line 18(a),
    the Detailed Summary Page has identified the allocable expenditure as Administrative
    in the amount of $4772.43. This change is found in the amended report. 3. Schedule
    H4 shows a reimbursement of %566.50 to Padilla LIbrado. This was a reimbursement
    for the purchase of an airline ticket for Mr. Librado for his services at a federal
    fundraising event. In addition, we have amended the type of event from Administrative
    to Fundraising, with no allocation applied. 4. Please be advised of the following
    changes on H4: a.) page 25, line A: This expense has been  changed from Administrative
    to Fundraising and purpose has been changed to fundraising consulting fees for
    federal services. b.) Page 25, line B: This expense has been changed from Administrative
    to Fundraising. The purpose of this expense has been changed to Catering for Federal
    Fundraising event.\n"
